export default function M() {
  return (
    <div
      className="relative flex w-full h-screen bg-black"
      style={{
        backgroundImage: `url('./pexels-alex-andrews-271121-86144.jpg')`,
        backgroundSize: "cover",
        backgroundPosition: "center",
        backgroundRepeat: "no-repeat",
      }}
    >
      <div
        className="absolute inset-0 bg-black opacity-50"
        style={{ zIndex: 1 }}
      ></div>
      <div
        className="relative flex rounded-lg h-auto mx-4 md:ml-32 md:mt-20 md:mr-20 w-full md:w-4/5"
        style={{
          backgroundImage: `url('./Component 1.png')`,
          backgroundSize: "cover",
          backgroundPosition: "center",
          backgroundRepeat: "no-repeat",
          zIndex: 2,
        }}
      >
        <div className="text-2xl md:text-5xl text-white mx-4 mt-10 md:ml-10 md:mt-20">
          <h1 className="text-3xl md:text-5xl text-blue-500">
            Mihisara <span className="text-white">Jayasinghe</span>
          </h1>
          <h2 className="text-2xl md:text-4xl text-blue-300 font-thin mt-2 md:mt-5">Software Developer</h2>
          <h2 className="text-lg md:text-xl text-gray-500">Code name - M Jay</h2>
          <h2 className="text-sm md:text-base mt-10 md:mt-20 w-full md:w-2/5 text-justify">
            I am a skilled software developer specializing in web development and Java programming. With expertise in MERN stack and WordPress, I have successfully delivered a variety of online projects. My passion lies in crafting efficient and user-friendly solutions that leverage cutting-edge technologies to solve complex challenges.
          </h2>
        </div>
      </div>
    </div>
  );
}
